import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Escritorio = () => {
    const [triajeList, setTriajeList] = useState('');
    const [planList, setPlanList] = useState('');

    useEffect(() => {
        const fetchTriaje = async () => {
            try {
                const token = localStorage.getItem('token');
                const result = await axios.post(
                    'http://localhost:3002/api/escritorio/triaje',
                    {},
                    {
                        headers: {
                            Authorization: `Bearer ${token}`
                        }
                    }
                );
                setTriajeList(result.data);
            } catch (error) {
                console.error('Error fetching Triaje:', error);
            }
        };

        const fetchPlan = async () => {
            try {
                const token = localStorage.getItem('token');
                const result = await axios.post(
                    'http://localhost:3002/api/escritorio/plan',
                    {},
                    {
                        headers: {
                            Authorization: `Bearer ${token}`
                        }
                    }
                );
                setPlanList(result.data);
            } catch (error) {
                console.error('Error fetching Plan:', error);
            }
        };

        fetchTriaje();
        fetchPlan();
    }, []);

    return (
        <div>
            <div id="triaje" dangerouslySetInnerHTML={{ __html: triajeList }} />
            <div id="plan" dangerouslySetInnerHTML={{ __html: planList }} />
        </div>
    );
};

export default Escritorio;
